import React from "react";
import { Link } from "react-router-dom";

const Navbar = () =>
{
    return(
        <div>
            <Link to="/employee/dashboard">Dashboard</Link>
            <Link to="/employee/profile/$id">ViewProfile</Link>
            <Link to="/employee/edit/$id">EditProfile</Link>
            <Link to="/employee/loanrequests">LoanRequest</Link>
            <Link to="/employee/Accountinfo">AccountList</Link>
            <Link to="/employee/news">News</Link>
            <Link to="/employee/logout">Logout</Link>
        </div>
    );
}
export default Navbar;
